import { Button, Result, Typography , Divider } from 'antd';
import {Link} from 'react-router-dom'


const { Title, Paragraph , Text} = Typography;

const RegisterFace = (props) => {

    return (
      <div className='app' >

        <Title>영상 녹화 방법</Title>
        <div>
        <Divider/>
        <div style={{margin : '0 auto'}}>
        <img src="https://user-images.githubusercontent.com/60956392/97309980-0dcb5800-18a6-11eb-8968-c74ef71ae421.gif" width="240" alt="guide"/>
        </div>
        <Divider/>
        <Paragraph> 위와 같이 최대한 <Text strong>상, 하, 좌, 우</Text> 다양한 각도로 얼굴을 찍어주세요. </Paragraph>
        </div>
        <div>
          <Link to='/face/webcam'>웹캠
          </Link>
        </div>
        <div>
          <Link to='/face/upload'>
          업로드 </Link>
        </div>
        </div>


    );

};

export default RegisterFace;
